import React from 'react';

const Dropdown = ({question, onChange, onBlur}) => {
    const data = [
        {value: 1, label: 'India'},
        {value: 2, label: 'USA'},
        {value: 3, label: 'UK'},
        {value: 4, label: 'Germany'},
        {value: 5, label: 'Russia'},
        {value: 5, label: 'Italy'},
    ];
    return (
        <div>
            <select
                name={question.key}
                value={question.value}
                onChange={onChange}
                onBlur={onBlur}>
                <option value="">{question.label}</option>
                {data.map((item, key) => (
                    <option
                        key={key}
                        value={item.value}>
                        {item.label}
                    </option>
                ))}
            </select>
        </div>
    )
};

export default Dropdown;
